import React from "react";

export default class About extends React.Component {
  componentDidMount() {
    console.log("aboutn mount");
  }

  render() {
    return (
      <div>
        <p>
          <b> Jie Liang Lin</b> is an interdisciplinary artist and media
          anthropologist based in Berlin.
          <br />
          <br />
          <br />
          <u>Project Consultants: </u> <br />
          <br />
          <b> Joanna Sleigh</b> on <i>Data Visualisation</i>
          <br />
          <b>Peggy Sylopp</b> on <i>Computer Science</i>
        </p>
      </div>
    );
  }
}
